def adi_part2(n: int, X: List[List[int]], A: List[List[int]], B: List[List[int]]) -> List[List[int]]:
    return matrix_col_slice(
        matrix_where(
            B,
            matrix_scalar_div(
                1,
                matrix_elemwise_mul(
                    A,
                    matrix_scalar_div(
                        1,
                        matrix_col_slice(B, 0, n-1)
                    )
                )
            ),
            lambda x, y: x - y
        ),
        1,
        n
    )
